create table user_balances
(
    id                         int unsigned auto_increment
        primary key,
    user_id                    int unsigned                       not null comment '用户ID',
    total_balance_in_cents     bigint unsigned                    not null comment '累计提现金额',
    withdrawn_balance_in_cents bigint unsigned                    not null comment '已提现金额',
    remaining_balance_in_cents bigint unsigned                    not null comment '剩余可提现金额',
    created_at                 datetime default CURRENT_TIMESTAMP not null,
    updated_at                 datetime                           null,
    deleted_at                 datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index user_balances_user_id_index
    on user_balances (user_id);

